import React from 'react';
import './Board.css';

const Augments = () => {
  return (
    <div style={{ background: '#18222F', padding: '10px', borderRadius: '8px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)' }}>
      <h2 style={{ color: '#ffffff', textAlign: 'center', marginBottom: '10px', marginTop: '10px', fontSize: '24px' }}>Traits</h2>

    </div>
  );
};

export default Augments;
